import React, { useEffect } from "react";

export default function AdminViewResults() {

  useEffect(() => {
    ViewAllStudentresult();
  }, []);

  const ViewAllStudentresult = () => {
    fetch("http://localhost:5000/getAllStudentResults", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data.data);
      });
    
  }

  return (
    <div>
      Hi
    </div>
  )
}
